import { Fragment, useState } from "react"
import '../SignInSignUpPage/SignInSignUpPage.css';

export const SignInSignUpPage = () => {
    const [activeTab, setActiveTab] = useState('student');

    const renderContent = () => {
        if (activeTab === 'student') {
            return <StudentLogin />;
        } else if (activeTab === 'faculty') {
            return <FacultyLogin />;
        }
    };

    return (<Fragment>
        <a className="link heading-1" href="/">Shikshana</a>
        <div className="login-container">

            <div className="tabs">
                <button
                    className={`tab ${activeTab === 'student' ? 'active' : ''}`}
                    onClick={() => setActiveTab('student')}
                >
                    Login/SignUp as Student
                </button>
                <button
                    className={`tab ${activeTab === 'faculty' ? 'active' : ''}`}
                    onClick={() => setActiveTab('faculty')}
                >
                    Login/SignUp as Faculty
                </button>
            </div>
            <div className="content">
                {renderContent()}
            </div>
        </div>
    </Fragment>)
}

const StudentLogin = () => {
    return (
        <div>
            <h2>Student Login</h2>
        </div>
    )
}

const FacultyLogin = () => {
    return (
        <div>
            <h2>Faculty Login</h2>
        </div>
    )
}
